import React from 'react';
import ReactDOM from 'react-dom';
import * as serviceWorker from './serviceWorker';
import Form from './template/form/main';

serviceWorker.register();

const forminit = {
    id : '',
    class : '223',
    method : 'get',
    token : 'token',
    hash : 'hash',
    inputs : [{
            name:'name',
            value:'张宇',
        }, {
            name:'sex',
            value:'男',
        }, {
            name:'text',
            value:'2018',
        }, {
            type:'textarea',
            value:'2018',
        }, {
            type:'select',
            selctors: [
                {
                    disabled : true,
                    selected : true,
                    desc:'text',
                    value:'0',
                },
                {
                    desc:'text',
                    value:'1',
                },
                {
                    desc:'text',
                    value:'1',
                },
                {
                    desc:'text',
                    value:'2',
                },
                {
                    desc:'text',
                    value:'3',
                },
            ]
        },
    ]
};

ReactDOM.render(<Form forminit={forminit} />, document.getElementById('app'));

serviceWorker.unregister();
